        <div className='container'>
            <img src={Folder} 
            style={{height: "120px", width: '120px',
            position: 'relative', right: '20px'}} 
            />
            <h1 className='pageTitle'>Projects</h1>
            <NavBar />
        </div>
    )
}

export default Projects
